import "./FicheProfesseurs.css"

export const FicheProfesseurs = ({nom, prenom, matiere}) => {
    return (
        <div className="professeurs">
            <h1>
                {nom} {prenom}
            </h1>
            <ul>
                {Object.keys(matiere).map((nomMatiere) => (
                    <li key={index}>
                        {nomMatiere}: {matiere[nomMatiere]}
                    </li>
                ))}
            </ul>
        </div>
    )
}
